  const changehandler=e=>{
    setdata({...data,[e.target.name]:e.target.value})
  }
  const submitHandler=e=>{
    e.preventDefault()
    if(password===confirmpassword)
    {
      console.log(data)
    }
    else{
      console.log("password mismatched")
    }
  }

  return(
    <div>
      <center>
        <form>
      <input type="text" placeholder="ENTER YOUR NAME"  value={username} onChange={changehandler}/>
        <input type="email" placeholder="ENTER YOUR EMAIL" value={email} onChange={changehandler}/>
